			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "\n## register executable to framework and framework to executable in the application Bundle\n\n## $1 framework executable\n## $2 application executable in MacOS folder\n## $3 path to frameworks in Frameworks\n## $4 core framework executable if != $1\n\n\n\n\nfunction _register_in_parent_framework ()\n{\n    echo \"install_name_tool -change $1 $2 $3\"\n    install_name_tool -change $1 $2 $3\n}\n\n\n## i.e. 2.2 to 2.2.x\nfunction _link_framework ()\n{\n    pushd \"$3\"\n    src=\"$1\"\n    dst=\"$2\"\n    echo \"Linking Canonical Name with Versioned Name $src <-> $dst\"\n    ln -s \"$src\" \"$dst\"\n    popd\n}\n\n\n\nfunction relocate_and_register_()\n{\n    echo \"arg1 is $1\"\n    echo \"arg2 is $2\"\n    echo \"arg3 is $3\"\n    local lastarg=${!#}\n        local extraOpArgN=3\n        \n        ## path to where frameworks go in the bundle\n        echo 'step 1:'\n        local frameworksLocation=\"`dirname $2`/../Frameworks\"\n        echo \"Relocating ${frameworksLocation}\"\n        local frameworkExecutable=\"${frameworksLocation}/$1\"\n        \n        ## Rewrite install_name of framework\n        echo 'step 2:'\n        local newInstallName=\"@executable_path/../Frameworks/$1\"\n        echo \"Relocating ${frameworkExecutable} as ${newInstallName}\" \n        install_name_tool -id \"${newInstallName}\" \"${frameworkExecutable}\"\n        ## Rewrite install_name in the app\n        echo 'step 3:'\n        \n        echo \"Relocating ${frameworkExecutable} as ${newInstallName} in application\" \n        ## We re-search originalInstallName, in application, because might be different.\n        local originalInstallName=`otool -L $2 | grep  $1 | sed -e 's/^\\([[:blank:]]*\\)\\(.*\\)\\( (.*\\)$/\\2/'`\n        echo \"install_name_tool -change ${originalInstallName} ${newInstallName} $2 \"\n        install_name_tool -change \"${originalInstallName}\" \"${newInstallName}\" \"$2\"\n        \n        ## if we have to also register this framework in the core framework\n        if [ $# = \"$extraOpArgN\" ]\n        then\n        originalInstallName=`otool -L \"$frameworksLocation/$3\"| grep  $1 | sed -e 's/^\\([[:blank:]]*\\)\\(.*\\)\\( (.*\\)$/\\2/'`\n        _register_in_parent_framework ${originalInstallName} ${newInstallName} $frameworksLocation/$3\n        fi\n    }\n    \n    function consumer_producer_register_()\n    {\n        echo \"CP: arg1 is $1 arg2 is $2 arg3 is $3\"   # register executable_path producer lib\n\n        ## path to where frameworks go in the bundle\n        echo 'step 1:'\n        local frameworksLocation=\"`dirname $2`/../Frameworks\"\n        echo \"Relocating ${frameworksLocation}\"\n        local frameworkExecutable=\"${frameworksLocation}/$3\"\n\n        echo \"newInstallName= @executable_path/../Frameworks/$1\"\n        local newInstallName=\"@executable_path/../Frameworks/$1\"\n        install_name_tool -change \"$1\" \"${newInstallName}\" \"$frameworkExecutable\"\n    }\n\n    \n    DYLIB=\"vfi386.framework/Versions/A/vfi386\"\n    applicationExecutable=\"${CONFIGURATION_BUILD_DIR}/Visible.app/Contents/MacOS/Visible\"\n    frameworksLocation=\"`dirname ${applicationExecutable}`/../Frameworks\"\n    ASCDYLIB=\"ASC_DCAM_DEV.framework/Versions/A/ASC_DCAM_DEV\"\n    \n    CVCORE_ALIAS=libopencv_core.2.2.dylib\n    CVHG_ALIAS=libopencv_highgui.2.2.dylib\n    CVIP_ALIAS=libopencv_imgproc.2.2.dylib\n    CVOD_ALIAS=libopencv_objdetect.2.2.dylib\n    LPLOT_ALIAS=liblightplot2d.1.dylib\n\n    CVCORE=libopencv_core.2.2.0.dylib\n    CVHG=libopencv_highgui.2.2.0.dylib\n    CVIP=libopencv_imgproc.2.2.0.dylib\n    CVOD=libopencv_objdetect.2.2.0.dylib\n    LPLOT=liblightplot2d.1.0.1.dylib\n\n    _link_framework $CVCORE $CVCORE_ALIAS $frameworksLocation\n    _link_framework $CVIP $CVIP_ALIAS $frameworksLocation\n    _link_framework $CVHG $CVHG_ALIAS $frameworksLocation\n    _link_framework $CVOD $CVOD_ALIAS $frameworksLocation\n    _link_framework $LPLOT $LPLOT_ALIAS $frameworksLocation\n\n    relocate_and_register_ $DYLIB $applicationExecutable\n    relocate_and_register_ $ASCDYLIB $applicationExecutable $DYLIB\n    relocate_and_register_ $CVCORE_ALIAS $applicationExecutable \n    relocate_and_register_ $CVHG_ALIAS $applicationExecutable\n    relocate_and_register_ $CVIP_ALIAS $applicationExecutable \n    relocate_and_register_ $CVOD_ALIAS $applicationExecutable \n    relocate_and_register_ $LPLOT_ALIAS $applicationExecutable\n\n    consumer_producer_register_ $CVHG_ALIAS $applicationExecutable $CVCORE\n    consumer_producer_register_ $CVIP_ALIAS $applicationExecutable $CVCORE\n    consumer_producer_register_ $CVOD_ALIAS $applicationExecutable $CVCORE\n    consumer_producer_register_ $CVCORE_ALIAS $applicationExecutable $CVHG\n    consumer_producer_register_ $CVIP_ALIAS $applicationExecutable $CVHG\n    consumer_producer_register_ $CVCORE_ALIAS $applicationExecutable $CVIP\n    consumer_producer_register_ $CVCORE_ALIAS $applicationExecutable $CVOD\n\n    consumer_producer_register_ $CVIP_ALIAS $applicationExecutable $CVOD\n    consumer_producer_register_ $CVOD_ALIAS $applicationExecutable $CVOD\n    consumer_producer_register_ $CVHG_ALIAS $applicationExecutable $CVOD\n\n    consumer_producer_register_ $LPLOT_ALIAS $applicationExecutable $LPLOT\n\n\n";
			showEnvVarsInLog = 0;
		};
